import React, {Component} from 'react';


class Navbar extends Component{

    render(){

        const  { item } = this.props;
        const listItem = item.map(item => {
            return(
                <table key={item.id}>
                    <tr>
                    <td>Name: { item.name }</td>
                    <td>Age: { item.age }</td>
                    <td>Sex: { item.sex}</td>
                    </tr>

                </table>
            )

        })


        return(

            <div className={'navbar'}>
                {listItem}
            </div>

        );
    }
}

export default Navbar;
